webpackJsonp([0xfcb042b9d3a4],{7714:function(e,t){e.exports={data:{post:{html:'<p>My absentee ballot for the November election arrived today. The fine folks at the Maricopa County Elections Department in Arizona are very good in that regard, I don\'t even have to request it. The races aren\'t all that exciting, Jon Kyl will be easily re-elected to the Senate and the Democrats don\'t even have a candidate to face Jeff Flake in my House district, but it\'s the thought that counts.</p>\n<p>If you\'re an expat and still need an absentee ballot, you can get more information at <a href="http://www.overseasvotefoundation.org/">Overseas Vote Foundation</a> (non-partisan) or <a href="http://www.votefromabroad.org/">VoteFromAbroad.org</a> (sponsored by <a href="http://www.democratsabroad.org/">Democrats Abroad</a>) or <a href="http://www.republicansabroad.org/states.html">Republicans Abroad</a>.</p>',fields:{title:"Vote!",date:"19 Oct 2006",url:"https://papascott.de/2006-10-19-vote/"}}},pathContext:{slug:"/2006-10-19-vote/",prev:{fields:{title:"McCafe Elmshorn Reloaded",date:"17 Oct 2006",slug:"/2006-10-17-mccafe-elmshorn-reloaded/"}},next:{fields:{title:"Male Bonding",date:"23 Oct 2006",slug:"/2006-10-23-male-bonding/"}}}}}});
